  vnl_matrix< double > pathVnl( *path, 100, 3 );
  PoistatsFilterType::MatrixType trialPath( pathVnl );
  
  itk::Array2D< int > roundedPath( trialPath.rows(), trialPath.cols() );
  
  // we want to obtain an index into our image, so round the path
  poistatsFilter->RoundPath( &roundedPath, &trialPath );

  PoistatsFilterType::ArrayPointer odfs[ 100 ];
  poistatsFilter->GetOdfsAtPoints( odfs, &roundedPath );
    
  const double meanPathEnergy = poistatsFilter->CalculateOdfPathEnergy( &trialPath, odfs, NULL );
  
  // this is the amount when the variance is 8*6
