void TestPoistats::GetOdfs( itk::Array2D< double >* odfs ) {
  std::string s;
  std::ifstream odfFile( "odflist.mat" );
  
  std::cerr << "reading odfs" << std::endl;

  for( unsigned int cRows=0; cRows<odfs->rows(); cRows++ ) {
    if( cRows%1000 == 0 ) {
      std::cerr << cRows << std::endl;
    }
    for( unsigned int cColumns=0; cColumns<odfs->cols(); cColumns++ ) {
      odfFile >> s;
      std::stringstream stream;
      double odf;
      stream << s;
      stream >> odf;
      
      ( *odfs )[ cRows ][ cColumns ] = odf;
    }
  }
  std::cerr << "finished reading odfs" << std::endl;  
}

void TestPoistats::GetOdfLookUpTable( itk::Array< double >* table ) {
  std::string s;
  std::ifstream odfFile( "flatlook.mat" );
  
  std::cerr << "reading lookup table" << std::endl;

  for( unsigned int cRows=0; cRows<table->size(); cRows++ ) {
    odfFile >> s;
    std::stringstream stream;
    double index;
    stream << s;
    stream >> index;
      
    ( *table )[ cRows ] = index;    
  }
  std::cerr << "finished lookup table" << std::endl;  
}


void TestPoistats::TestRoundPath() {
  
  std::cerr << "TestRoundPath" << std::endl;  
  
  typedef TensorReaderStrategy::TensorPixelType TensorPixelType;
  typedef TensorReaderStrategy::TensorImageType TensorImageType;
  typedef itk::Image<float, 3> FloatImage3DType;
  typedef itk::PoistatsFilter< TensorImageType, FloatImage3DType > 
    PoistatsFilterType;
  
  const int numberOfRows = 2;
  const int numberOfColumns = 3;
  
  itk::Array2D< int > roundedArray( numberOfRows, numberOfColumns );
  
  itk::Array2D< double > notRoundedArray( numberOfRows, numberOfColumns );  
  notRoundedArray[ 0 ][ 0 ] = 0.1;
  notRoundedArray[ 0 ][ 1 ] = 0.5;
  notRoundedArray[ 0 ][ 2 ] = 1.9;

  notRoundedArray[ 1 ][ 0 ] = 10.1;
  notRoundedArray[ 1 ][ 1 ] = 2.8;
  notRoundedArray[ 1 ][ 2 ] = 5.1;
  
  itk::Array2D< int > expectedRoundedArray(numberOfRows, numberOfColumns );
  expectedRoundedArray[ 0 ][ 0 ] = 0;
  expectedRoundedArray[ 0 ][ 1 ] = 1;
  expectedRoundedArray[ 0 ][ 2 ] = 2;

  expectedRoundedArray[ 1 ][ 0 ] = 10;
  expectedRoundedArray[ 1 ][ 1 ] = 3;
  expectedRoundedArray[ 1 ][ 2 ] = 5;
  
  PoistatsFilterType::RoundPath( &roundedArray, &notRoundedArray );
  for( int cRow = 0; cRow < numberOfRows; cRow++ ) {
    for( int cColumn = 0; cColumn < numberOfColumns; cColumn++ ) {
    
      int actual = roundedArray[ cRow ][ cColumn ];
      int result = expectedRoundedArray[ cRow ][ cColumn ];
      
      CPPUNIT_ASSERT_EQUAL( actual, result );    
    }
  }
  
}

