void TestPoistats::TestGetDistance() {

  std::cerr << "TestGetDistance" << std::endl;  

  typedef TensorReaderStrategy::TensorPixelType TensorPixelType;
  typedef TensorReaderStrategy::TensorImageType TensorImageType;
  typedef itk::Image< float, 4 > FloatImage4DType;
  typedef itk::PoistatsFilter< TensorImageType, FloatImage4DType > 
    PoistatsFilterType;

  vnl_vector< double > point1( 3 );
  point1[ 0 ] = 0.2;
  point1[ 1 ] = 20.1;
  point1[ 2 ] = 3;
  
  itk::Array< double > point2( 3 );
  point2[ 0 ] = 4.5;
  point2[ 1 ] = 2.1;
  point2[ 2 ] = -5;
  
  const double expectedDistance = 20.16159715895544;
  const double actualDistance = 
    PoistatsFilterType::GetDistance( &point1, &point2 );

  const double tolerance = 0.00005;
  CPPUNIT_ASSERT_DOUBLES_EQUAL( expectedDistance, actualDistance, tolerance );
}
  
void TestPoistats::TestGetPointClosestToCenter() {

  std::cerr << "TestGetPointClosestToCenter" << std::endl;  

  typedef TensorReaderStrategy::TensorPixelType TensorPixelType;
  typedef TensorReaderStrategy::TensorImageType TensorImageType;
  typedef itk::Image< float, 4 > FloatImage4DType;
  typedef itk::PoistatsFilter< TensorImageType, FloatImage4DType > 
    PoistatsFilterType;

  itk::Array2D< double > seeds( 3, 3 );
  seeds[ 0 ][ 0 ] = 56; 
  seeds[ 0 ][ 1 ] = 73;
  seeds[ 0 ][ 2 ] = 30;

  seeds[ 1 ][ 0 ] = 56; 
  seeds[ 1 ][ 1 ] = 74;
  seeds[ 1 ][ 2 ] = 30;

  seeds[ 2 ][ 0 ] = 57; 
  seeds[ 2 ][ 1 ] = 74;  
  seeds[ 2 ][ 2 ] = 29;
  
  itk::Array< double > closestSeed( seeds.cols() );
  PoistatsFilterType::GetPointClosestToCenter( &seeds, &closestSeed );
  
  const int indexOfCloset = 1;
  
  for( unsigned int cDim=0; cDim<closestSeed.size(); cDim++ ) {
    CPPUNIT_ASSERT_EQUAL( seeds[ indexOfCloset ][ cDim ],
                          closestSeed[ cDim ] );    
  }

}

void TestPoistats::TestGetCenterOfMass() {

  std::cerr << "TestGetCenterOfMass" << std::endl;  

  typedef TensorReaderStrategy::TensorPixelType TensorPixelType;
  typedef TensorReaderStrategy::TensorImageType TensorImageType;
  typedef itk::Image< float, 4 > FloatImage4DType;
  typedef itk::PoistatsFilter< TensorImageType, FloatImage4DType > 
    PoistatsFilterType;
    
  const double expectedCenter[] = {5.633333333333334e+01, 
                                   7.366666666666667e+01, 
                                   2.966666666666667e+01 };

  itk::Array2D< double > mass( 3, 3 );
  mass[ 0 ][ 0 ] = 56; 
  mass[ 0 ][ 1 ] = 73;
  mass[ 0 ][ 2 ] = 30;

  mass[ 1 ][ 0 ] = 56; 
  mass[ 1 ][ 1 ] = 74;
  mass[ 1 ][ 2 ] = 30;

  mass[ 2 ][ 0 ] = 57; 
  mass[ 2 ][ 1 ] = 74;  
  mass[ 2 ][ 2 ] = 29;
  
  itk::Array< double > center( 3 );
  
  PoistatsFilterType::GetCenterOfMass( &mass, &center );

  const double tolerance = 0.00005;
  for( unsigned int cDim=0; cDim<center.size(); cDim++ ) {
    CPPUNIT_ASSERT_DOUBLES_EQUAL( expectedCenter[ cDim ], center[ cDim ], 
                                  tolerance );    
  }
  
}

void TestPoistats::TestConvertPointsToImage() {
  
  std::cerr << "TestConvertPointsToImage" << std::endl;  
  
  typedef TensorReaderStrategy::TensorPixelType TensorPixelType;
  typedef TensorReaderStrategy::TensorImageType TensorImageType;
  typedef itk::Image< float, 3 > OutputImageType;
  typedef itk::PoistatsFilter< TensorImageType, OutputImageType > 
    PoistatsFilterType;
      
  PoistatsFilterType::MatrixType points( 3, 3 );
//  points = [ 11.1, 11.1, 11.1;
//             13.6, 10.1, 3.4; 
//             5.5, 5.5, 12.5 ]
  points[ 0 ][ 0 ] = 11.1; 
  points[ 0 ][ 1 ] = 11.1;
  points[ 0 ][ 2 ] = 11.1;

  points[ 1 ][ 0 ] = 13.6; 
  points[ 1 ][ 1 ] = 10.1;
  points[ 1 ][ 2 ] = 3.4;

  points[ 2 ][ 0 ] = 5.5; 
  points[ 2 ][ 1 ] = 5.5;
  points[ 2 ][ 2 ] = 12.5;
  
  OutputImageType::Pointer image = OutputImageType::New();  
  OutputImageType::SizeType size;
  size[ 0 ] = 15;  // x direction
  size[ 1 ] = 15;  // y direction
  size[ 2 ] = 15;   // z direction

  OutputImageType::IndexType start;
  start[ 0 ] = 0;   // x direction
  start[ 1 ] = 0;   // y direction
  start[ 2 ] = 0;   // z direction 

  typedef itk::ImageFileReader< OutputImageType > ReaderType;  
  ReaderType::Pointer reader = ReaderType::New();
  reader->SetFileName( "test/data/Path.nii.gz" );  
  reader->Update();

  OutputImageType::Pointer expectedImage = reader->GetOutput();
  
  OutputImageType::RegionType region;
  region.SetSize( size );
  region.SetIndex( start );

  image->CopyInformation( expectedImage );
  
  image->SetRegions( region );
  image->Allocate();
  image->FillBuffer( 0 );

  PoistatsFilterType::Pointer poistatsFilter = PoistatsFilterType::New();  
  poistatsFilter->ConvertPointsToImage( &points, image );
          
  itk::ImageRegionConstIterator< OutputImageType > expectedIterator( 
    expectedImage, expectedImage->GetLargestPossibleRegion() );
  
  itk::ImageRegionConstIterator< OutputImageType > actualIterator( 
    image, image->GetLargestPossibleRegion() );
      
  const double tolerance = 0.0005;
  for (
    expectedIterator = expectedIterator.Begin(), 
      actualIterator = actualIterator.Begin(); 
        
    !expectedIterator.IsAtEnd() && !actualIterator.IsAtEnd(); 
        
    ++expectedIterator, ++actualIterator ) {

    const float actual = actualIterator.Value();      
    const float expected = expectedIterator.Value();
        
    CPPUNIT_ASSERT_DOUBLES_EQUAL( expected, actual, tolerance );    
    
  }
  
}

