void TestPoistats::TestGetAggregateReplicaDensities() {
  
  std::cerr << "TestGetAggregateReplicaDensities" << std::endl;  

  typedef itk::Image< float, 3 > OutputImageType;
  typedef TensorReaderStrategy::TensorPixelType TensorPixelType;
  typedef TensorReaderStrategy::TensorImageType TensorImageType;
  typedef itk::PoistatsFilter< TensorImageType, OutputImageType > 
    PoistatsFilterType;

  TensorReaderStrategy *tensorReader = new AsymmetricTensorReaderStrategy();
  tensorReader->SetFileName( "data/dtensor.nii" );
  TensorImageType::Pointer tensors = tensorReader->GetTensors();  
  delete tensorReader;
  tensorReader = NULL;
  
  PoistatsFilterType::Pointer poistatsFilter = PoistatsFilterType::New();
  poistatsFilter->SetInput( tensors );

  const int nReplica = 3;

  PoistatsFilterType::ArrayType replicaEnergies( nReplica );
  PoistatsFilterType::MatrixListType replicaPaths;
  
  for( int cReplica=0; cReplica<nReplica; cReplica++ ) {
    replicaEnergies[ cReplica ] = static_cast< double >( cReplica + 1);
    
    PoistatsFilterType::MatrixPointer path = 
      new PoistatsFilterType::MatrixType( 5, 3 );
    for( unsigned int cRow=0; cRow<path->rows(); cRow++ ) {
      for( unsigned int cCol=0; cCol<path->cols(); cCol++ ) {
        ( *path )[ cRow ][ cCol ] = cRow + cCol + cReplica + 24;
      }
    }    
    replicaPaths.push_back( path );
  }
  
  OutputImageType::Pointer aggregateDensities = OutputImageType::New();
  OutputImageType::SizeType size;
  size[ 0 ] = 128;  // x direction
  size[ 1 ] = 128;  // y direction
  size[ 2 ] = 60;   // z direction

  OutputImageType::IndexType start;
  start[ 0 ] = 0;   // x direction
  start[ 1 ] = 0;   // y direction
  start[ 2 ] = 0;   // z direction 
  
  OutputImageType::RegionType region;
  region.SetSize( size );
  region.SetIndex( start );

  aggregateDensities->SetRegions( region );
  aggregateDensities->Allocate();
  aggregateDensities->FillBuffer( 0 );

//  poistatsFilter->GetAggregateReplicaDensities( &replicaEnergies, replicaPaths,
//    aggregateDensities );    
  poistatsFilter->GetAggregateReplicaDensities( replicaPaths,
                                                aggregateDensities );    
    
  typedef itk::ImageFileReader< OutputImageType > AggregateDensityReaderType;  
  AggregateDensityReaderType::Pointer aggregateReader = 
    AggregateDensityReaderType::New();
  aggregateReader->SetFileName( "data/AggregateDensity.nii" );
  aggregateReader->Update();
  OutputImageType::Pointer expectedAggregateDensity = aggregateReader->GetOutput();
  
  itk::ImageRegionConstIterator< OutputImageType > aggregateIterator( 
    aggregateDensities, aggregateDensities->GetLargestPossibleRegion() );

  itk::ImageRegionConstIterator< OutputImageType > expectedAggregateIterator( 
    expectedAggregateDensity, 
    expectedAggregateDensity->GetLargestPossibleRegion() );

  const double tolerance = 0.0000005;
  for ( 
    aggregateIterator = aggregateIterator.Begin(), 
      expectedAggregateIterator = expectedAggregateIterator.Begin();
    
    !aggregateIterator.IsAtEnd() && !expectedAggregateIterator.IsAtEnd(); 
    
    ++aggregateIterator, ++expectedAggregateIterator ) {
    
    const float actual = aggregateIterator.Value();
    const float expected = expectedAggregateIterator.Value();

    CPPUNIT_ASSERT_DOUBLES_EQUAL( expected, actual, tolerance );    
    
  }
    
}

void TestPoistats::TestMask() {

  std::cerr << "TestMask" << std::endl;  
  
  const int originalMaskValues[] = { 
    -1, 0, 2, 
    4, 1, 0, 
    0, 0, 1,
     
    -1, 0, 2, 
    4, 1, 0, 
    0, 0, 1,

    -1, 0, 2, 
    4, 1, 0, 
    0, 0, 1 };

  const int expectedMask[] = { 
    1, 0, 1, 
    1, 1, 0, 
    0, 0, 1,

    1, 0, 1, 
    1, 1, 0, 
    0, 0, 1,

    1, 0, 1, 
    1, 1, 0, 
    0, 0, 1 };


  typedef itk::Image< float, 3 > OutputImageType;
  typedef TensorReaderStrategy::TensorPixelType TensorPixelType;
  typedef TensorReaderStrategy::TensorImageType TensorImageType;
  typedef itk::PoistatsFilter< TensorImageType, OutputImageType > 
    PoistatsFilterType;

  PoistatsFilterType::MaskVolumePointer originalMask = 
    PoistatsFilterType::MaskVolumeType::New();

  PoistatsFilterType::MaskVolumeSizeType maskSize;
  for( int cDim=0; cDim<3; cDim++ ) {
    maskSize[ cDim ] = 3;
  }
      
  PoistatsFilterType::MaskVolumeRegionType maskRegion;
  maskRegion.SetSize( maskSize );
  originalMask->SetRegions( maskRegion );
  
  originalMask->Allocate();
  originalMask->FillBuffer( 0 );
  
  typedef itk::ImageRegionIterator< PoistatsFilterType::MaskVolumeType > 
    MaskIteratorType;

  MaskIteratorType originalMaskIterator(
    originalMask, originalMask->GetLargestPossibleRegion() );

  int cValue = 0;
  // go through all pixels and assign value of 1 for all non-zero
  for( originalMaskIterator = originalMaskIterator.Begin(); 
       !originalMaskIterator.IsAtEnd(); ++originalMaskIterator ) {
    originalMaskIterator.Set( originalMaskValues[ cValue++ ] );      
  }

  PoistatsFilterType::Pointer poistatsFilter = PoistatsFilterType::New();

  poistatsFilter->SetMaskVolume( originalMask );
  PoistatsFilterType::MaskVolumePointer actualMask = 
    poistatsFilter->GetMaskVolume();
  
  MaskIteratorType actualMaskIterator( 
    actualMask, actualMask->GetLargestPossibleRegion() );
  
  cValue = 0;
  // make sure that the non zero pixel are now 1
  for( actualMaskIterator = actualMaskIterator.Begin(); 
       !actualMaskIterator.IsAtEnd(); ++actualMaskIterator ) {

    const PoistatsFilterType::MaskType actual = actualMaskIterator.Value();      
    const int expected = expectedMask[ cValue++ ];
    CPPUNIT_ASSERT_EQUAL( actual, expected );
    
  }

  PoistatsFilterType::SizeType inputSize;
  PoistatsFilterType::IndexType inputStart;
  double inputOrigin[ 3 ];
  for( int cDim=0; cDim<3; cDim++ ) {
    inputSize[ cDim ] = 3;
    inputStart[ cDim ] = 0;
    inputOrigin[ cDim ] = 0;
  }
  inputSize[ 2 ] = 9;
      
  PoistatsFilterType::RegionType inputRegion;
  inputRegion.SetSize( inputSize );
  inputRegion.SetIndex( inputStart );
  
  PoistatsFilterType::InputImagePointer inputImage = 
    PoistatsFilterType::InputImageType::New();
  inputImage->SetRegions( inputRegion );
  inputImage->SetOrigin( inputOrigin );
  inputImage->Allocate();  
  inputImage->FillBuffer( 0.5 );
  
  poistatsFilter->SetInput( inputImage );
  
  const double sliceUpData[] = { 1, 0, 0 };
  PoistatsFilterType::ArrayType sliceUp( sliceUpData, 3 );

// TODO: create an image with this cosine direction
//  poistatsFilter->SetSliceUp( sliceUp );

  poistatsFilter->ConstructOdfList();
    
  typedef itk::ImageRegionIterator< PoistatsFilterType::OdfLookUpTableType > 
    OdfTableIteratorType;

  OdfTableIteratorType odfTableIterator( poistatsFilter->GetOdfLookUpTable(), 
                                         poistatsFilter->GetOdfLookUpTable()->GetLargestPossibleRegion() );
  
  const int invalidIndex = -1;

  // assert that the odfs are masked
  for(
    odfTableIterator = odfTableIterator.Begin(), 
      actualMaskIterator = actualMaskIterator.Begin(); 
    
    !odfTableIterator.IsAtEnd(),
      !actualMaskIterator.IsAtEnd();
    
    ++odfTableIterator,
      ++actualMaskIterator ) {
  
    const int odfLookUp = odfTableIterator.Value();
    const PoistatsFilterType::MaskType maskValue = actualMaskIterator.Value();
        
    if( maskValue == 0 ) {
      CPPUNIT_ASSERT_EQUAL( odfLookUp, invalidIndex );
    } else {
      CPPUNIT_ASSERT( odfLookUp != invalidIndex );
    }
    
  }
    
}

